-- ----------------------------
-- View structure for viewsystem_log
-- ----------------------------
DROP VIEW IF EXISTS `viewsystem_log`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `viewsystem_log` AS select `fw_login`.`id_login` AS `id_login`,`fw_login`.`open` AS `open`,`fw_login`.`fecha_login` AS `fecha_login`,`fw_login`.`ultima_verificacion` AS `ultima_verificacion`,`fw_login`.`fecha_logout` AS `fecha_logout`,`fw_login`.`tiempo_session` AS `tiempo_session`,`fw_login`.`ipv4` AS `ipv4`,`fw_usuarios`.`usuario` AS `usuario`,`fw_roles`.`descripcion` AS `descripcion`,`sistemas`.`id_sistema` AS `id_sistema` from ((((`fw_login` join `fw_usuarios` on((`fw_login`.`id_usuario` = `fw_usuarios`.`id_usuario`))) join `fw_roles` on((`fw_usuarios`.`id_rol` = `fw_roles`.`id_rol`))) join `sistemas_usuario` on((`sistemas_usuario`.`id_usuario` = `fw_usuarios`.`id_usuario`))) join `sistemas` on((`sistemas_usuario`.`id_sistema` = `sistemas`.`id_sistema`)));

-- ----------------------------
-- View structure for view_log
-- ----------------------------
DROP VIEW IF EXISTS `view_log`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_log` AS select `fw_login`.`id_login` AS `id_login`,`fw_login`.`open` AS `open`,`fw_login`.`fecha_login` AS `fecha_login`,`fw_login`.`ultima_verificacion` AS `ultima_verificacion`,`fw_login`.`fecha_logout` AS `fecha_logout`,`fw_login`.`tiempo_session` AS `tiempo_session`,`fw_login`.`ipv4` AS `ipv4`,`fw_usuarios`.`usuario` AS `usuario`,`fw_roles`.`descripcion` AS `descripcion`,`sistemas_usuario`.`id_sistema` AS `id_sistema` from (((`fw_login` join `fw_usuarios` on((`fw_login`.`id_usuario` = `fw_usuarios`.`id_usuario`))) join `fw_roles` on((`fw_usuarios`.`id_rol` = `fw_roles`.`id_rol`))) join `sistemas_usuario` on((`sistemas_usuario`.`id_usuario` = `fw_usuarios`.`id_usuario`)));

-- ----------------------------
-- View structure for view_logins
-- ----------------------------
DROP VIEW IF EXISTS `view_logins`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_logins` AS select `fw_login`.`id_login` AS `id_login`,`fw_usuarios`.`usuario` AS `usuario`,concat(`fw_usuarios`.`nombres`,' ',`fw_usuarios`.`apellido_paterno`,' ',`fw_usuarios`.`apellido_materno`) AS `nombre`,`fw_login`.`fecha_login` AS `fecha_login`,`fw_login`.`ultima_verificacion` AS `ultima_verificacion`,`fw_login`.`ipv4` AS `ipv4`,`fw_login`.`session_id` AS `session_id`,`fw_usuarios`.`id_usuario` AS `id_usuario`,`sistemas_usuario`.`id_sistema` AS `id_sistema` from ((`fw_login` join `fw_usuarios` on((`fw_login`.`id_usuario` = `fw_usuarios`.`id_usuario`))) join `sistemas_usuario` on((`sistemas_usuario`.`id_usuario` = `fw_usuarios`.`id_usuario`))) where (`fw_login`.`open` = 1);

-- ----------------------------
-- View structure for view_sistemas
-- ----------------------------
DROP VIEW IF EXISTS `view_sistemas`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_sistemas` AS select `sistemas`.`id_sistema` AS `id_sistema`,`sistemas`.`nombre` AS `nombre`,`sistemas`.`nombre_largo` AS `nombre_largo`,`sistemas`.`descripcion` AS `descripcion` from `sistemas` where (`sistemas`.`id_sistema` <> 1);

-- ----------------------------
-- View structure for view_usuarios
-- ----------------------------
DROP VIEW IF EXISTS `view_usuarios`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_usuarios` AS select `fw_usuarios`.`id_usuario` AS `id_usuario`,`fw_usuarios`.`usuario` AS `usuario`,`fw_usuarios`.`correo` AS `correo`,`fw_usuarios`.`nombres` AS `nombres`,`fw_usuarios`.`apellido_paterno` AS `apellido_paterno`,`fw_usuarios`.`apellido_materno` AS `apellido_materno`,`fw_roles`.`descripcion` AS `descripcion`,`fw_usuarios`.`cat_status` AS `cat_status` from (`fw_usuarios` join `fw_roles` on((`fw_usuarios`.`id_rol` = `fw_roles`.`id_rol`)));

-- ----------------------------
-- View structure for view_usuarios_sistemas
-- ----------------------------
DROP VIEW IF EXISTS `view_usuarios_sistemas`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_usuarios_sistemas` AS select `fw_usuarios`.`id_usuario` AS `id_usuario`,`fw_usuarios`.`usuario` AS `usuario`,`fw_usuarios`.`nombres` AS `nombres`,`fw_usuarios`.`apellido_paterno` AS `apellido_paterno`,`fw_usuarios`.`apellido_materno` AS `apellido_materno`,`fw_roles`.`descripcion` AS `descripcion`,`fw_usuarios`.`correo` AS `correo`,`fw_usuarios`.`cat_status` AS `cat_status`,`sistemas`.`id_sistema` AS `id_sistema` from (((`fw_usuarios` join `sistemas_usuario` on((`sistemas_usuario`.`id_usuario` = `fw_usuarios`.`id_usuario`))) join `sistemas` on((`sistemas_usuario`.`id_sistema` = `sistemas`.`id_sistema`))) join `fw_roles` on((`fw_usuarios`.`id_rol` = `fw_roles`.`id_rol`)));

